script: |
  super -f text -I q6562.spq | sort > q6562.out

inputs:
  - name: q6562.spq
    data: |
      SELECT ALL * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + col1 + col0 BETWEEN col0 + col2 * + col0 AND + col1 + + ( col0 - col0 ) / ( 46 );
  - name: tab0

outputs:
  - name: q6562.out
    data: |
      15	81	47
      87	21	10
      97	1	99
